<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <meta http-equiv="X-UA-Compatible" content="ie=edge">
        <script src="https://ajax.aspnetcdn.com/ajax/jQuery/jquery-3.3.1.min.js"></script>
        <title>Document</title>
        <style>

            span{
                cursor: pointer;
            }

            .div-background{
                position: absolute;
                width: 100%;
            }
            .div-panel{
                background-color: transparent;
                position: absolute;
                bottom: 33%;
                z-index: 1;
                min-width: 48%;
                margin-left: 47%;
                margin-right: 7%;
                height: 7%;
                display: flex;
                flex-direction: row;
                justify-content: space-around;
                align-items: flex-start;
                align-content: flex-start;
            }
            .flex-item{
                border: 2px solid #898d93;
                border-radius: 0.2em;
                margin-left: 10px;
                margin-right: 10px;
                width: 89%;
                height: 89%;
                flex-grow: 1;
                flex-shrink: 1;
                margin-top: 1%;
                margin-bottom: 1%;
                border: none;
                text-align: center;
            }

            .divCurtain{
                position: absolute;
                height: 1500px;
                width: 100%;
                min-width: 100%;
                margin: 0;
                z-index: 10000;
                background-color: rgba(0,0,0,0.8);
                top: 0;
            }

            .divLayoutCurtain{
                background-color: #ffffff;
                border-radius: 0.3em;
                height: 80%;
                margin-top: 5%;
                opacity: 1;
                border: 1px solid black;
                position: fixed;
                width: 50%;
            }

            .styleClose{
                position: absolute;
                width: 35px;
                height: 35px;
                background-color: white;
                border-radius: 1em;
                margin-left: 98%;
                bottom: 97%;
            }
            .close {
                margin-left: 30%;
                margin-right: 30%;
                color: #aaaaaa;
                font-size: 28px;
                font-weight: bold;
            }
            span#button-1, span#button-2, span#button-3{
                font-size: 13vw;
                color: transparent;
            }
        </style>
        <script>
            $(document).ready(function()
            {
                var backgroundHeight = $(".div-background").height();
                var divLayoutCurtainWidth = $("iframe").width() + 10;
                var divLayoutCurtainHeight = $("iframe").height() + 10;

                $(".divCurtain").css("height", backgroundHeight);
                $(".divLayoutCurtain").css("height", divLayoutCurtainHeight);
                $(".divLayoutCurtain").css("width", divLayoutCurtainWidth);

                // $("iframe").css("width", divLayoutCurtainWidth);
                // $("iframe").css("height", divLayoutCurtainHeight);

                $("#button-1").click(function()
                {
                    $("#divCurtain-1").fadeIn("slow");
                    $("#divLayoutCurtain-1").fadeIn("slow");
                });

                $("#spanClose-1").click(function()
                {
                    $("#divCurtain-1").fadeOut("slow");
                    $("#divLayoutCurtain-1").fadeOut("slow");
                });

                $("#button-2").click(function()
                {
                    $("#divCurtain-2").fadeIn("slow");
                    $("#divLayoutCurtain-2").fadeIn("slow");
                });

                $("#spanClose-2").click(function()
                {
                    $("#divCurtain-2").fadeOut("slow");
                    $("#divLayoutCurtain-2").fadeOut("slow");
                });

                $("#button-3").click(function()
                {
                    $("#divCurtain-3").fadeIn("slow");
                    $("#divLayoutCurtain-3").fadeIn("slow");
                });

                $("#spanClose-3").click(function()
                {
                    $("#divCurtain-3").fadeOut("slow");
                    $("#divLayoutCurtain-3").fadeOut("slow");
                });

                var imgHeight = $("#img-background").height();
                var imgWidth = $("#img-background").width();

                $("#div-main").css("height", imgHeight);
                $("#div-main").css("width", imgWidth);
                $("#div-background").css("height", imgHeight);
            });
        </script>
    </head>
